      description: "Details\n \n Automatic 5-station press with Lock-N-Load quick\
        \ change technology. This progressive press features fully automatic indexing,\
        \ a 5-station die platform that accepts most standard 7/8\"-14 threaded dies\
        \ and the EZ-ject System which delivers 100% reliable cartridge ejection.\
        \ The Lock-N-Load AP is capable of loading rifle or handgun cartridges with\
        \ large or small primers. Wondering what extra parts to purchase? Well, the\
        \ press comes complete with a Lock-N-Load Powder Measure, case activated powder\
        \ drop, cartridge catcher, primer pick-up tubes and 5 Lock-N-Load Bushings,\
        \ so the only thing left for you to purchase is the easy access shellplate,\
        \ dies and any additional bushings you'll need. All items in this kit feature\
        \ a lifetime warranty from Hornady."
